// components/admin/dashboard/ItemDueCard.jsx
import React from "react";

const ItemDueCard = ({ containers = [] }) => {
  const rows = [];

  containers.forEach((rack) => {
    rack.slots.forEach((slot) => {
      (slot.items || []).forEach((item) => {
        (item.taken || []).forEach((t) => {
          const today = new Date();
          const returnDate = t.returnDate ? new Date(t.returnDate) : null;

          let overdue = 0;
          if (returnDate) {
            overdue = Math.max(
              0,
              Math.floor((today - returnDate) / (1000 * 60 * 60 * 24))
            );
          }

          rows.push({
            itemName: item.name,
            user: t.user,
            takenDate: t.date,
            returnDate: t.returnDate || "-",
            overdue,
          });
        });
      });
    });
  });


   return (
  <div
    className="card shadow-sm"
    style={{
      background: "hsl(215, 25%, 12%)",
      border: "1px solid hsl(215, 20%, 25%)",
      color: "white",
      height: "100%",
    }}
  >
    <div
      className="card-header fw-bold"
      style={{ borderColor: "hsl(215,25%,25%)" }}
    >
      Item Due Dates
    </div>

    <div
      className="card-body"
      style={{
        maxHeight: "320px",
        overflowY: "auto",
        paddingRight: "6px",
      }}
    >
      <div
        style={{
          borderRadius: "8px",
          overflow: "hidden",
          border: "1px solid hsl(215,20%,20%)",
        }}
      >
        <table className="table table-sm mb-0" style={{ color: "white" }}>
          <thead
            style={{
              background: "hsl(215, 25%, 18%)",
              position: "sticky",
              top: 0,
              zIndex: 5,
            }}
          >
            <tr>
              <th style={{ padding: "10px 12px" }}>Item</th>
              <th style={{ padding: "10px 12px" }}>Taken By</th>
              <th style={{ padding: "10px 12px" }}>Taken</th>
              <th style={{ padding: "10px 12px" }}>Return</th>
              <th style={{ padding: "10px 12px" }}>Overdue</th>
              <th></th>
            </tr>
          </thead>

          <tbody>
            {rows.length === 0 ? (
              <tr>
                <td
                  colSpan="6"
                  className="text-center"
                  style={{
                    padding: "20px",
                    color: "#b8bdc5",
                  }}
                >
                  No due items
                </td>
              </tr>
            ) : (
              rows.map((r, i) => (
                <tr
                  key={i}
                  style={{
                    background:
                      i % 2 === 0
                        ? "hsl(215, 25%, 14%)"
                        : "hsl(215, 25%, 16%)",
                  }}
                >
                  <td style={{ padding: "10px 12px" }}>{r.itemName}</td>
                  <td style={{ padding: "10px 12px" }}>{r.user}</td>
                  <td style={{ padding: "10px 12px" }}>{r.takenDate}</td>
                  <td style={{ padding: "10px 12px" }}>{r.returnDate}</td>
                  <td style={{ padding: "10px 12px" }}>{r.overdue} days</td>

                  <td style={{ padding: "10px 12px" }}>
                    <button className="btn btn-primary btn-sm">Reminder</button>
                  </td>
                </tr>
              ))
            )}
          </tbody>
        </table>
      </div>
    </div>
  </div>
);

};

export default ItemDueCard;
